import React, {useEffect} from 'react'
import {HeaderTitle} from '../../components/HeaderTitle/HeaderTitle'
import {useStoreModel} from '../../ModelAction/useStore'
import {pageTypeEnum, shopCartModel} from './index'
import styled from 'styled-components'
import { ls } from '../../tools/dealKey'
import {PickUpTypeEnum} from '../../ss_common/enum'

const Title = styled.div`
  font-size: 18px;
  font-weight: bold;
`

export const OrderPage = () => {
  const {state: stateSCM, actions: actionsSCM} = useStoreModel(shopCartModel)

  useEffect(() => {
    if (!stateSCM.user.id) {
      actionsSCM.getOrderInfo()
    }
  }, [])

  return <div>
    <HeaderTitle
        title={'确认订单'}
        backCall={() => {
          actionsSCM.updatePageType(pageTypeEnum.shopCart)
          return true
        }}
    />
    <Title>{ls((stateSCM.form.pickUpType === PickUpTypeEnum.Self && '自取地址') || '送货地址')}</Title>



  </div>
}
